const navStyles = css`
  display: flex;
  flex-flow: row wrap;
  gap: 1rem;
  /* margin: ${fluid(48, 96, SM, XXL)} 0; */

  button {
    display: flex;
    align-items: center;
    gap: 0.5rem;
    padding: 0.5rem 1.25rem;
    background-color: rgba(255, 255, 255, 0.25);
    border: 1px solid var(--color-sawdust);
    border-radius: 4px;
    text-align: center;
    text-decoration: none;
    text-transform: uppercase;
    letter-spacing: 0.03125rem;
    font-family: var(--ff-mono);
    font-weight: var(--fw-medium);
    color: var(--color-slate);
    cursor: pointer;
    transition: background-color 0.25s, color 0.25s;

    &:hover {
      background-color: rgba(255, 255, 255, 0.5);
      color: var(--color-night);
    }

    &.active {
      background-color: rgba(255, 255, 255, 0.75);
      color: var(--color-night);
    }
  }
`;

const colors = [...primaryColors, ...secondaryColors];

const styles = ['Symbol', 'QCDG', 'Queen City', 'Queen City Development Group'];

const variants = {
  hidden: {
    opacity: 0,
    x: 0,
    y: -20,
    transition: {
      duration: 0.25,
      ease: EASE_IN,
    },
  },
  enter: {
    opacity: 1,
    x: 0,
    y: 0,
    transition: {
      duration: 0.5,
      ease: EASE_OUT,
    },
  },
  exit: {
    opacity: 0,
    x: 0,
    y: 20,
    transition: {
      duration: 0.25,
      ease: EASE_IN,
    },
  },
};

export default function Logo() {
  const [logoFill, setLogoFill] = useState(colors[0].hex);
  const [logoStyle, setLogoStyle] = useState('QCDG');
  const backgroundColor = hexToLuminance(logoFill) > 0.5 ? 'var(--color-slate)' : 'var(--color-sand)';

  return (
    <>
      <Section>
        <h2>Logo</h2>
        <p>
          The QCDG logo is a unique and distinctive visual representation of your brand, carefully crafted to evoke building
          structures, a target, a clover, and the coming together of four unique partners to form a greater whole.
        </p>
        <File name="QCDG Brand Guidelines.pdf" size="12.5 MB" href="/QCDG Brand Guidelines.pdf" target="_blank" />
      </Section>
      <Section>
        <h3>Color</h3>
        <div css={navStyles}>
          {colors.map((color) => {
            return (
              <button
                key={color.name}
                onClick={() => setLogoFill(color.hex)}
                className={logoFill === color.hex ? 'active' : undefined}>
                <div css={{ width: '1rem', aspectRatio: 1, backgroundColor: color.hex }}></div>
                <span>{color.name}</span>
              </button>
            );
          })}
        </div>
      </Section>
      <Section>
        <h3>Style</h3>
        <div css={navStyles}>
          {styles.map((style) => {
            return (
              <button key={style} onClick={() => setLogoStyle(style)} className={logoStyle === style ? 'active' : undefined}>
                <span>{style}</span>
              </button>
            );
          })}
        </div>
      </Section>
      <Section>
        <div
          css={{
            padding: '1rem',
            display: 'flex',
            aspectRatio: 2,
            alignItems: 'center',
            justifyContent: 'center',
            backgroundColor: backgroundColor,
            borderRadius: 4,
            border: '1px solid var(--color-sawdust)',
          }}>
          <AnimatePresence mode="wait">
            {logoStyle === 'Symbol' && (
              <motion.div key="Symbol" initial="hidden" animate="enter" exit="exit" variants={variants}>
                <LogoSymbol fill={logoFill} css={{ height: '8rem', width: 'auto', path: { transition: 'fill 0.25s' } }} />
              </motion.div>
            )}
            {logoStyle === 'QCDG' && (
              <motion.div key="QCDG" initial="hidden" animate="enter" exit="exit" variants={variants}>
                <LogoQCDG fill={logoFill} css={{ height: '8rem', width: 'auto', path: { transition: 'fill 0.25s' } }} />
              </motion.div>
            )}
            {logoStyle === 'Queen City' && (
              <motion.div key="Queen City" initial="hidden" animate="enter" exit="exit" variants={variants}>
                <LogoQueenCity fill={logoFill} css={{ height: '8rem', width: 'auto', path: { transition: 'fill 0.25s' } }} />
              </motion.div>
            )}
            {logoStyle === 'Queen City Development Group' && (
              <motion.div key="Queen City Development Group" initial="hidden" animate="enter" exit="exit" variants={variants}>
                <LogoQueenCityDevelopmentGroup
                  fill={logoFill}
                  css={{ height: '8rem', width: 'auto', path: { transition: 'fill 0.25s' } }}
                />
              </motion.div>
            )}
          </AnimatePresence>
        </div>
      </Section>
    </>
  );
}
